import React from "react";


const Jumbotron = () => {
  return (
    <div class="jumbotron">
    <div class="container">
      <h1>Sample Name</h1>
      <p>
      This is a platform for viewing or creating WebDev profiles.  
      </p>
      <p>
      Browse Web Devs for your next job, or add your name to the list for future employers to see!
      </p>
    </div>
  </div>
   
  )
}

export default Jumbotron;
